import BookCard from "./BookCard.js"


const Shelf = ({loadLibrary, shelf }) => {
    return(
        shelf.map(book => {
            return (
                <BookCard loadLibrary={loadLibrary} book={book} /> 
            )
        })
    )
}


export default Shelf
